import React from 'react';

import Box from '@mui/material/Box';
import Divider from "@mui/material/Divider";
import NavigateNextIcon from '@mui/icons-material/NavigateNext';
import AccountCircleOutlinedIcon from '@mui/icons-material/AccountCircleOutlined';
import AccountCircleIcon from '@mui/icons-material/AccountCircle';
import AdUnitsOutlinedIcon from '@mui/icons-material/AdUnitsOutlined';
import AodOutlinedIcon from '@mui/icons-material/AodOutlined';
import ArticleOutlinedIcon from '@mui/icons-material/ArticleOutlined';
import StickyNote2OutlinedIcon from '@mui/icons-material/StickyNote2Outlined';
import AodIcon from '@mui/icons-material/Aod';

import DisplaySettingsIcon from '@mui/icons-material/DisplaySettings';
import ArticleIcon from '@mui/icons-material/Article';
import InfoOutlinedIcon from '@mui/icons-material/InfoOutlined';
import InfoIcon from '@mui/icons-material/Info';

export default function Setting() {
    
    return (
        <Box sx={{ width: "800px" }} >
            <div>
                <AccountCircleOutlinedIcon fontSize="small" sx={{ color:"black"}} />
                
                <p>계정</p>
                <NavigateNextIcon fontSize="small" sx={{ color: "lightgray" }} />
            </div>
            <Divider />
            
            <div>
                <AodOutlinedIcon fontSize="medium"  sx={{ color:"black" }} />

                <p>화면</p>
                <NavigateNextIcon fontSize="small" sx={{ color: "lightgray" }}  />
            </div>
            <Divider />

            <div>
                
                <ArticleOutlinedIcon fontSize="medium" sx={{ color:"black"}} />
                <p>공지사항</p>
                <NavigateNextIcon fontSize="small" sx={{ color: "lightgray" }}  />
            </div>
            <Divider />

            <div>
                
                <InfoOutlinedIcon fontSize="medium" sx={{ color:"black"}} />
                <p>정보</p>
                <NavigateNextIcon fontSize="small" sx={{ color: "lightgray" }}  />
            </div>

        </Box>
    )

}
